query NewsletterV3ViewerEdge($newsletterSlug: ID!, $collectionSlug: ID, $username: ID) {
  newsletterV3(
    newsletterSlug: $newsletterSlug
    collectionSlug: $collectionSlug
    username: $username
  ) {
    ... on NewsletterV3 {
      id
      viewerEdge {
        ...NewsletterV3ViewerEdge_newsletterV3ViewerEdge
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment NewsletterV3ViewerEdge_newsletterV3ViewerEdge on NewsletterV3ViewerEdge {
  id
  isSubscribed
  __typename
}
